import React from 'react';
import {
    View, 
    Image, TouchableOpacity
} from 'react-native';
import { createBottomTabNavigator, BottomTabBar } from '@react-navigation/bottom-tabs';
import { Home } from '../screens';
import {COLORS, icons } from '../constants';
 const Tab = createBottomTabNavigator();

 const Tabs = () => {
     return (
         <Tab.Navigator
            tabBarOptions={{
                showLabel: false, 
                style: {
                    backgroundColor: 'transparent',
                    borderTopWidth: '0'
                }
            }}         
         >
             <Tab.Screen
                name='Home'
                component={Home}
                options={{
                    tabBarIcon: ({focused}) => {
                        const image = focused ? icons.cutlery : icons.cutleryDisable;  
                        return (
                        <Image
                            source={image}
                            resizeMode='contain'
                            style={{
                                width: 25,
                                height: 25,
                                tinColor: focused ? COLORS.primary : COLORS.secondary
                            }}
                        />
                        )
                    }
                }}
             />
             <Tab.Screen
                name='Search'
                component={Home}
                options={{
                    tabBarIcon: ({focused}) => {
                        const image = focused ? icons.search : icons.searchDisable;  
                        return (
                        <Image
                            source={image}
                            resizeMode='contain'
                            style={{
                                width: 25,
                                height: 25,
                            }}
                        />
                        )
                    }
                }}
             />
             <Tab.Screen
                name='Like'
                component={Home}
                options={{
                    tabBarIcon: ({focused}) => {
                        const image = focused ? icons.like : icons.likeDisable;  
                        return (
                        <Image
                            source={image}
                            resizeMode='contain'
                            style={{
                                width: 25,
                                height: 25,
                                tinColor: focused ? COLORS.primary : COLORS.secondary
                            }}
                        />
                        )
                    }

                }}
             />
              <Tab.Screen
                name='User'
                component={Home}
                options={{
                    tabBarIcon: ({focused}) => {
                        const image = focused ? icons.user : icons.userDisable;
                        return (
                            <Image
                                source={image}
                                resizeMode='contain'
                                style={{
                                    width: 25,
                                    height: 25,
                                }}
                            />
                        )
                    }
                }}
             />
         </Tab.Navigator>
     )
 }

 export default Tabs;
